function factorial(n){
  if (n < 2) return '1';
  
  function genDigitArray(n) {
    let res = []
    while(n > 0){
      res.push(n%10)
      n = Math.trunc(n/10)
    }
    return res;
  }
  
  function multiply(n,xs)
  {
    var res = [], carry = 0
    for(var x of xs) {
      var prod = x * n + carry
      res.push(prod % 10)
      carry = Math.trunc(prod / 10)
    }
    
    while (carry > 0) {
      res.push(carry % 10)
      carry = Math.trunc(carry / 10)
    }
    
    return res;
  }
  
  var res = genDigitArray(n);
  for(--n; n > 0; --n) {
    res = multiply(n, res);
  }
  
  return res.reduceRight((a,x) => a + x, '');
}

