function mult(str, n){
  let acc = 0, res = '', arr = str.split('');
  while (arr.length>0) {
    acc += n*arr.pop();
    res = (acc%10) + res;
    acc = acc/10>>0;
  }
  return acc ? acc + res : res;
}
function factorial(n){
  let f = String(n);
  while(n-->1) f = mult(f, n);
  return f;
}

function factorial(n){
  if (n < 0) {
    return null;
  }
  if (n=== 0 || n === 1) {
    return '1';
  }
  
  let result = '1';
  for (let i = 2; i <= n; i++) {
    result = multiply(result, i.toString());
  }
  
  return result;
}

