function multiply(digits, num) {
  let carry = 0;
  for (let i = 0; i < digits.length; i++) {
    const product = digits[i] * num + carry;
    digits[i] = product % 10;
    carry = Math.floor(product / 10);
  }
  while (carry > 0) {
    digits.push(carry % 10);
    carry = Math.floor(carry / 10);
  }
  return digits;
}

